import React from "react";
import { useSelector } from "react-redux";
import { AddTodo } from "./addTodo";
import { MdDelete } from "react-icons/md";
export const Todo = () => {
    const todos = useSelector((state) => state.todos);
    return (
        <div>
            <h1>Todo List</h1>
        <AddTodo />
            <ul>
                {todos.map((todo) => {
                    return (
                        <li key={todo.id}>
                            <span>{todo.text}</span>
                            <MdDelete />
                        </li>
                    )
                })}

            </ul>
        </div>


    )
}
